import React from 'react';
import GameCanvas from './GameCanvas';
import '../styles/CloudShooter.css';

const CloudShooter = () => {
  return (
    <div className="cloud-shooter-container">
      <h1 
        className="cloud-shooter-title"
        style={{ '--azure-icon': `url(${process.env.PUBLIC_URL}/azure-icons/Microsoft_Azure_Cyan.svg)` }}
      >
        ZURE CLOUD SHOOTER
      </h1>
      <GameCanvas />
    </div>
  );
};

export default CloudShooter;
